  Product Overview for Microsoft Visual Basic v6.0
Professional Edition

As Microsoft releases the sixth version of its award-winning development tool, more than 50 percent of all professional developers are using the Visual Basic language. Visual Basic 6.0 is the most productive tool for creating high-performance enterprise and Web-based applications. Integrated Visual Database Tools and a RAD environment promote productivity while native code compilation provides fast applications.

BENEFITS

    * Use the Visual Basic 6.0 integrated Visual Database Tools and new Data Environment Designer to visually design Oracle and Microsoft SQL Server databases and create reusable data access queries--all without leaving the Visual Basic environment.

    * Build server-side Web applications that are easily accessible from any browser on any platform with Visual Basic 6.0 WebClasses. Program highly interactive Web pages as easily as a Visual Basic form with the new Dynamic HTML Page Designer.

    * Quickly develop rich data forms, or use the new integrated Report Writer to develop sophisticated, hierarchical reports, all with drag-and-drop ease. 

